import React, { Component } from 'react';
import Form from 'react-jsonschema-form';
import { connect } from 'react-redux';

class RUColumn extends Component {
  log = type => console.log.bind(console, type);
  updateData() {
    debugger;
    this.props.dispatch({ type: 'UPDATE', data: {} });
  }
  getData() {
    var dataFromGet = this.props.dispatch({ type: 'GET' });
    console.log(`dataFromGet : ${dataFromGet}`);
    return dataFromGet;
  }

  render() {
    return (
      <div>
        <Form
          id="read-update"
          schema={this.props.schema}
          formData={this.getData()}
          onSubmit={() => this.props.dispatch({ type: 'UPDATE', data: {} })}
          onError={this.log('errors')}
        />
      </div>
    );
  }
}

export default connect()(RUColumn);
